import AuthService from "../services/auth.service"

const Profile = () => {
    const currentUser = AuthService.getCurrentUser();

    return(
        <div className="container">
            <header className="jumbotron">
                <h3>
                    <strong>
                        {currentUser.email}
                    </strong>
                    Profile
                </h3>
            </header>
        </div>
    )
}
export default Profile;
